import React, { useEffect, useState } from 'react'
import Aqua from '../../Themes/Aqua/Aqua'
import { Darker } from '../../Themes/Darker/Darker'
import axios from 'axios'

function StoreView() {
 const [theme, setTheme] = useState('aqua')
 const [products, setProducts] = useState([])

 const getProducts =async()=>{
    const res = await axios.get('https://menuit.widecity.in/api/product?shop_owner_username=amal&division_name=main hall&store_name=malabar')
    console.log(res.data)
    setProducts(res.data)
 }
 const data = {
    'store_name':'malabar',
    'contact':'9946658045',
    'license':'74237482394237497239',
    'products':products
 }

 useEffect(()=>{
   //  getProducts()
 },[])

  return (
    <div>
        {theme === 'aqua'?<Aqua data = {data}/>:""}
        {theme === 'darker'?<Darker data={data}/>:""}
    </div>
  )
}

export default StoreView
